import React from 'react'

const navigation = [
  // { name: 'Dashboard', href: '#', current: true },
  { name: 'Login', href: '#', current: true },
  { name: 'More', href: '#', current: false },
  { name: 'Cart', href: '#', current: false },
]
export const Navbar = (props: {}) => {
  return (
    <nav>
      <div className="flex  justify-around bg-blue-600">
        <div> Logo </div>
        <div className=' bg-white p-1 m-2 rounded flex'>

          <input name="search-label" placeholder='search...' type="input" className='bg-white px-2 py-1 text-gray-400' />
          <svg aria-hidden="true" className="self-center w-5 h-5 text-gray-500 dark:text-gray-400" fill="currentColor" viewBox="0 0 20 20" xmlns="http://www.w3.org/2000/svg"><path fill-rule="evenodd" d="M8 4a4 4 0 100 8 4 4 0 000-8zM2 8a6 6 0 1110.89 3.476l4.817 4.817a1 1 0 01-1.414 1.414l-4.816-4.816A6 6 0 012 8z" clip-rule="evenodd"></path></svg>
        </div>
        <div className="flex">
          {navigation.map((item) => (
            <a
              className='px-2'
              key={item.name}
              href={item.href}
              aria-current={item.current ? 'page' : undefined}
            >
              {item.name}
            </a>
          ))}
        </div>
      </div>
    </nav>
  )
}
